  padding: 5px;
  width: 80px;
  margin: 10px auto;
  display: block;
`;

const Input = styled.input`
  width: 200px;
  border: 1px solid ;
  display: block;
`;

class Api extends Component {
  state = {};
  componentDidMount() {
    // fetch("")
  }
  render() {
    return (
      <Wrapper>
        <h1>API page</h1>
        <Button>Hello</Button>
        <Input placeholder="Hello" />
      </Wrapper>
    );
  }
}

export default Api;
